Pitch.create!([
  {id: 7, day_id: 1, proposer: "Daniel", name: "Teacher testing materials", created_at: "2014-09-24 18:17:49", updated_at: "2014-09-24 18:17:49", description: "Teacher in k12 - testing is pain. Get three strikes on failure or school faces closure / privatization. App where can bring test questions together based on e.g. science, 5th grade. Student can register finish level by level."},
  {id: 8, day_id: 1, proposer: "Jeremy", name: "Habit track", created_at: "2014-09-24 18:18:55", updated_at: "2014-09-24 18:18:55", description: "Habit tracking app. Existing apps complicated. Have to form habit that have done habits. Single page where you can check off habits to say you've done them. Track patters"},
  {id: 9, day_id: 1, proposer: "Victor", name: "Hashtag hashtag", created_at: "2014-09-24 18:20:08", updated_at: "2014-09-24 18:20:08", description: "Hashtags. People talk about them as if they matter. Central repo that scrapes through them and pull them together to present on 1 page (e.g ranking over last hour/day) and tehn click on tag to see profile  - diff articles, tweets. Allow user comments on a hashtag. Diff to  google"},
  {id: 10, day_id: 1, proposer: "Nick", name: "Notes extension", created_at: "2014-09-24 18:21:01", updated_at: "2014-09-24 18:21:01", description: "Watching video. Notes in another tab. Chrome extension that pops up bottom of browser so while wathhing / reading can take notes. Export to evernote / g drive / dropbox."},
  {id: 11, day_id: 1, proposer: "Stefan", name: "Spouser / spousify / spouse me", created_at: "2014-09-24 18:21:50", updated_at: "2014-09-24 18:21:50", description: "America has lots of problems. No visa / green card. Dating website for people to find green"},
  {id: 12, day_id: 1, proposer: "Jeremy", name: "Calendar work / pay", created_at: "2014-09-24 18:22:34", updated_at: "2014-09-24 18:22:34", description: "Similar to other but inspired by sis. Random hours, dunno how much you'll work. Would take shifts and figure out income."},
  {id: 13, day_id: 1, proposer: "Victor", name: "Smash Social", created_at: "2014-09-24 18:23:28", updated_at: "2014-09-24 18:23:28", description: "Built game for second project asses. Smash TV - multiplayer game. Play points have character. Customize character. Social aspect."},
  {id: 14, day_id: 1, proposer: "Nick", name: "Smorgasbord", created_at: "2014-09-24 18:24:29", updated_at: "2014-09-24 18:24:29", description: "Reddit calls itself front page but still a pain to use. Smorgasbord of social media  - youtube, vine, reddit, etc. Get to see all coolest media relevant to you."},
  {id: 15, day_id: 1, proposer: "Stefan", name: "The Prayer app", created_at: "2014-09-24 18:25:16", updated_at: "2014-09-24 18:25:16", description: "Prayer powerful thing. Mostly do alone. App where people can share prayers with people all over world"},
  {id: 17, day_id: 1, proposer: "Victor", name: "Video-ifier", created_at: "2014-09-24 18:27:09", updated_at: "2014-09-24 18:27:09", description: "Music: was very interested in music and videos while growing up. App to merge playlists from spotify / youtube. Match with vimeo / vevo and find "},
  {id: 18, day_id: 1, proposer: "Nick", name: "Muso Leaderboard", created_at: "2014-09-24 18:28:32", updated_at: "2014-09-24 18:28:32", description: "New game - rap test. Quizzes on rap stars. Goes through discography. Have to guess title of song. Propose: app where user can put in artist that want to play with. generate test to play difficulty of songs. Spotify / soundcloud. Leaderboards by artist. See how you compare to others"},
  {id: 19, day_id: 1, proposer: "Sarah", name: "Is it real?", created_at: "2014-09-24 18:30:36", updated_at: "2014-09-24 18:30:36", description: "Like politifact - fact checks claims. Keeps track of claims. I think great if could make chrome extension  - interrogate somewhere to figure out whether the page you're looking at now is true."},
  {id: 20, day_id: 1, proposer: "Steve", name: "Hugle", created_at: "2014-09-24 18:31:32", updated_at: "2014-09-24 18:31:32", description: "Asks coding questions to phase zero students. Would be good practice."},
  {id: 21, day_id: 1, proposer: "Stefan", name: "Rankings", created_at: "2014-09-24 18:32:44", updated_at: "2014-09-24 18:32:44", description: "user ratings don't work. Half say it's awesome. Other half says it's terrible. Build site where you can log in and put in the one that you think is best in category - e.g. my best shampoo. You don't rank, you just pick."},
  {id: 22, day_id: 1, proposer: "Nick", name: "Resume tester", created_at: "2014-09-24 18:33:32", updated_at: "2014-09-24 18:33:32", description: "Resumes - don't know impact have on employers. Something that will do a/b testing for resumes. Gauge response. Heat map?"},
  {id: 23, day_id: 1, proposer: "Stefan", name: "Gather app", created_at: "2014-09-24 18:34:32", updated_at: "2014-09-24 18:34:32", description: "E.g. some games need ten people. Need some way to find people to participate. Post stuff you want to do and others can sign up until teams are full."},
  {id: 24, day_id: 1, proposer: "Sarah", name: "Travel App", created_at: "2014-09-24 18:35:38", updated_at: "2014-09-24 18:35:38", description: "Travel app. When go to new city tells you waht's popular near you and what they use them for. E.g. come to NYC, see people use yelp a lot and that they search for Ramen."},
  {id: 25, day_id: 1, proposer: "Sam", name: "Transparency in beacons", created_at: "2014-09-24 18:37:16", updated_at: "2014-09-24 18:37:16", description: "Would be good to look into what ghostery tracks, analyze and see what they provide to sites that use them. Make transparent version and offer to sites that use them."},
  {id: 26, day_id: 1, proposer: "Steve", name: "Music player", created_at: "2014-09-24 18:38:04", updated_at: "2014-09-24 18:38:04", description: "Like music - like to play a song on my phone put play on multiple devices"},
  {id: 27, day_id: 1, proposer: "Sarah", name: "Accountability", created_at: "2014-09-24 18:39:12", updated_at: "2014-09-24 18:39:12", description: "Anonymity blessing and curse. App that keeps track of sites that allow anonymous free speech and track how many things go unnaccounted for."},
  {id: 28, day_id: 1, proposer: "Anthony", name: "Cohort Wars", created_at: "2014-09-24 18:40:03", updated_at: "2014-09-24 18:40:03", description: "Never see phase 0 students in other locations again. Gaming platform to allow cohort in NY to compete against equiv cohorts in CHI and SF."},
  {id: 29, day_id: 1, proposer: "Stefan", name: "Old movie theater", created_at: "2014-09-24 18:40:55", updated_at: "2014-09-24 18:40:55", description: "People like movies. Only show new stuff. What if want to see Godfather in Imax. Create website where can book a theater and say we'll watch the godfather. If enough sign up, it happens."},
  {id: 31, day_id: 1, proposer: "Sam", name: "One bar", created_at: "2014-09-24 18:42:54", updated_at: "2014-09-24 18:42:54", description: "User can play one midi instrument for one bar. Anyone else can come along and add a bar or layer on your bar with another instrument"},
  {id: 32, day_id: 1, proposer: "Myles", name: "Low hanging fruit", created_at: "2014-09-24 18:43:55", updated_at: "2014-09-24 18:43:55", description: "Take github url and it criticizes low hanging fruit. Spelling errors, commented out code, common mistakes."},
  {id: 33, day_id: 1, proposer: "Nick", name: "Associate Me", created_at: "2014-09-24 18:45:00", updated_at: "2014-09-24 18:45:00", description: "Gem to run through associations and makes sure they are there. Tells users what associations and methods exist."},
  {id: 34, day_id: 1, proposer: "Brendan", name: "Favorite Sites", created_at: "2014-09-24 18:45:50", updated_at: "2014-09-24 18:45:50", description: "Most people have four or five sites that check. SPA that allows you to pick those and build a page."},
  {id: 35, day_id: 1, proposer: "Stefan", name: "Smoke with me", created_at: "2014-09-24 18:46:21", updated_at: "2014-09-24 18:46:21", description: "App that lets you call numbers in sequence until someone picks up"},
  {id: 36, day_id: 1, proposer: "Jeremy", name: "Text Scheduler", created_at: "2014-09-24 18:47:23", updated_at: "2014-09-24 18:47:23", description: "App where can schedule texts. Everyone has someone they text on a schedule. Let you set up schedule and have the texts sent."},
  {id: 37, day_id: 1, proposer: "Sarah", name: "Curated NewsFeed", created_at: "2014-09-24 18:48:20", updated_at: "2014-09-24 18:48:20", description: "For parents - take just children's or immediate family's facebook / twitter / instagram."},
  {id: 42, day_id: 1, proposer: "Chris", name: "Multiplayer six degrees of Kevin Bacon", created_at: "2014-09-24 18:52:41", updated_at: "2014-09-24 18:52:41", description: "How close are you to the optimum Bacon route."},
  {id: 38, day_id: 1, proposer: "Stef", name: "Charge me", created_at: "2014-09-24 18:49:45", updated_at: "2014-09-24 18:49:45", description: "Split utilities etc with people live with. App to figure out splits. Would track e.g. I pay Con Ed and you pay Verizon. App would total up total contributed, who owes what and sends reminders."},
  {id: 40, day_id: 1, proposer: "Peter", name: "I'm confused about", created_at: "2014-09-24 18:51:32", updated_at: "2014-09-24 18:51:32", description: "When on e.g. SO read question that might be my question but I'm not sure. Create a layer on top of Q&A site. Side bar shows questions other people have in response to reading these answers."},
  {id: 39, day_id: 1, proposer: "Chris", name: "Let's play it", created_at: "2014-09-24 18:50:36", updated_at: "2014-09-24 18:50:36", description: "Create networking app where can play private / public games."},
  {id: 41, day_id: 1, proposer: "Faraz", name: "Fiver?", created_at: "2014-09-24 18:52:10", updated_at: "2014-09-24 18:52:10", description: "Post problem and incentivize people to fix it"},
  {id: 43, day_id: 1, proposer: "Stefan", name: "Restored Faceboot", created_at: "2014-09-24 19:31:27", updated_at: "2014-09-24 19:31:27", description: "Networking for DBC alumni and students"}
])
